<br>Hunter ハンターのHunter Slideです。
<br>
<br>カラーは全部で4色。
<br>防水性に優れ、雨の日でも
<br>気軽に履いてお出かけができます。
<br>アウトドアやちょっとした時にでも大活躍間違いなし。
<br>シンプルさの中に存在を主張する
<br>甲幅のHunterロゴがアクセントに。
<br>インソール部は足に合わせての
<br>くぼみが作られており、フィット感も抜群です。
<br>素材は強度,伸縮性に優れた天然ゴムを使用。
<br>丁寧に一つ一つ手作業で作りこまれた一品です。
<br>デザイン性・機能性とともに優れた
<br>サンダルです。
<br>
<br>深みのある色味など
<br>細部にまでこだわりを感じます。
<br>
<br>*HUNTER ハンター
<br>1856年にスコットランドの正統派
<br>ラバーブーツのブランドとして創業。
<br>イギリス本国では知らない人が
<br>居ないと言われるほど
<br>知名度と信頼性の高い老舗メーカー。
<br>機能性とファッショナブルなカラーやデザインで
<br>人気を誇る、英国御用達レインブーツブランドです。
<br>職人によるハンドメイドで作られたブーツは、
<br>天然ゴムのみを使用。
<br>ケイト・モスやニコール・リッチー、
<br>アンジェリーナ・ジョリーといった
<br>ハリウッドセレブにも愛用者が
